import React, { Component } from "react";

class Toc extends Component {
  render() {
    console.log("Toc");
    const data = this.props.data;

    let lists = data.map((el) => {
      <li key={el.id}>
        <a href={"/content/" + el.id}>{el.title}</a>
      </li>;
    });

    return (
      <nav>
        <ul>{lists}</ul>
      </nav>
    );
  }
}

export default Toc;
